syntax "proto3";

package aws;

message AwsElb {
  access_logs = 1;
  arn = 2;
  availability_zones = 3;
  connection_draining = 4;
  connection_draining_timeout = 5;
  cross_zone_load_balancing = 6;
  dns_name = 7;
  health_check = 8;
  id = 9;
  idle_timeout = 10;
  instances = 11;
  internal = 12;
  listener = 13;
  name = 14;
  security_groups = 15;
  source_security_group = 16;
  source_security_group_id = 17;
  subnets = 18;
  tags = 19;
  zone_id = 20;
}